Here's the Java code:

public boolean isPowerOfThree(int n) {
    if (n <= 0 || n >= 231) {
        return false;
    }
    int mask = 1;
    while ((n & mask)!= 0) {
        mask <<= 1;
    }
    return (n & mask) == 0;
}

