Here is an example implementation of a queue data structure using two stacks in Python:

```
class Queue:
    def __init__(self):
        self.stack_1 = []
        self.stack_2 = []

    def enqueue(self, element):
        self.stack_1.append(element)

    def dequeue(self):
        if not self.stack_1:
            raise IndexError('Queue is empty')
        return self.stack_1.pop()

    def is_empty(self):
        return self.stack_1 == []
```

